a=h.it("2. Information We Collect","We may collect information about you in a variety of ways:\n\nPersonal Data\nWhen you register for an account, we may collect:\n\u2022 Email address\n\u2022 Display name (optional)\n\u2022 Profile picture (if using Google Sign-In)\n\nUsage Data\nWe automatically collect certain information when you use the Service:\n\u2022 Device information (device type, operating system)\n\u2022 App usage data (pages viewed, features used)\n\u2022 IP address\n\u2022 Browser type (for web access)\n\nSaved Preferences\n\u2022 Deals you have saved/bookmarked\n\u2022 Category preferences\n\u2022 Notification settings")
c=h.it("3. How We Use Your Information","We use the information we collect to:\n\n\u2022 Provide, maintain, and improve our Service\n\u2022 Create and manage your account\n\u2022 Send you deal notifications based on your preferences\n\u2022 Personalize your experience and show relevant deals\n\u2022 Respond to your comments, questions, and requests\n\u2022 Monitor and analyze usage trends to improve user experience\n\u2022 Send you technical notices, updates, and administrative messages\n\u2022 Protect against fraudulent or illegal activity")
s=h.it("4. Information Sharing and Disclosure","We do not sell, trade, or rent your personal information to third parties. We may share your information in the following situations:\n\nService Providers\nWe may share your information with third-party vendors who perform services on our behalf, such as:\n\u2022 Analytics providers (Google Analytics)\n\u2022 Cloud hosting services\n\u2022 Authentication services (Google Sign-In)\n\nLegal Requirements\nWe may disclose your information if required by law or in response to valid requests by public authorities.\n\nBusiness Transfers\nIf we are involved in a merger, acquisition, or sale of assets, your information may be transferred as part of that transaction.")
r=h.it("5. Affiliate Links and Third-Party Services","Our Service contains affiliate links to third-party retailers including:\n\u2022 Amazon Associates Program\n\u2022 Walmart Affiliate Program\n\u2022 Target Affiliate Program\n\u2022 Other retail partners\n\nWhen you click on these links, you will be directed to third-party websites that have their own privacy policies. We are not responsible for the privacy practices of these external sites. We encourage you to review their privacy policies before providing any personal information.")
q=h.it("6. Data Security","We implement appropriate technical and organizational security measures to protect your personal information, including:\n\n\u2022 Encryption of data in transit (HTTPS/TLS)\n\u2022 Secure authentication mechanisms\n\u2022 Regular security assessments\n\u2022 Access controls and authentication for our systems\n\nHowever, no method of transmission over the Internet or electronic storage is 100% secure. While we strive to protect your personal information, we cannot guarantee its absolute security.")
p=h.it("7. Data Retention","We retain your personal information for as long as your account is active or as needed to provide you services. We will retain and use your information as necessary to:\n\n\u2022 Comply with our legal obligations\n\u2022 Resolve disputes\n\u2022 Enforce our agreements\n\nYou may request deletion of your account and associated data at any time by contacting us.")
o=h.it("8. Your Rights and Choices","Depending on your location, you may have the following rights:\n\n\u2022 Access: Request access to your personal information\n\u2022 Correction: Request correction of inaccurate data\n\u2022 Deletion: Request deletion of your personal information\n\u2022 Portability: Request a copy of your data in a portable format\n\u2022 Opt-out: Opt out of marketing communications\n\nTo exercise these rights, please contact us using the information below.")
n=h.it("9. Children's Privacy","Our Service is not intended for children under the age of 13. We do not knowingly collect personal information from children under 13. If you are a parent or guardian and believe your child has provided us with personal information, please contact us immediately so we can delete such information.")
m=h.it("10. International Data Transfers","Your information may be transferred to and maintained on servers located outside of your state, province, country, or other governmental jurisdiction where data protection laws may differ. By using our Service, you consent to such transfers.")
l=h.it("11. Changes to This Privacy Policy",'We may update this Privacy Policy from time to time. We will notify you of any changes by posting the new Privacy Policy on this page and updating the "Last updated" date. You are advised to review this Privacy Policy periodically for any changes.')
k=h.it("12. Contact Us","If you have any questions about this Privacy Policy or our privacy practices, please contact us at:\n\nEmail: hunter4dealsapp@gmail.com\n\nWe will respond to your inquiry within a reasonable timeframe.")
